  return (
    <Col lg="8" className=' border border-dark m-1'>
    <Row>

        <Col lg="7" className='bg-primary'>

            <h1>Lista</h1>

        </Col>

        <Col lg="5" className='bg-danger'>

            <h1>Grafica</h1>

        </Col>

    </Row>

    </Col>
  )
}
